export function About() {


  return (
    <div id="aboutme" className="about-page flex">
        <div className="about-page-container">
          <div className="about-title section-title">
            About Me<span> .</span>
          </div>
          <div className="about-body">
          I'm an App Developer at the University of Exeter. I'm passionate about programming and dabbling in design. I love making user & browser-friendly websites and apps, and am currently delving into machine learning and its applications.

I'm currently learning more about Swift and using machine learning in apps to solve problems. Feel free to contact me by email or check out my work on GitHub.
          </div>
        </div>
    </div>
  );
}
